Description:
Το πρωί ο πρωθυπουργός θριαμβολογούσε για την αγορά των F35. Τα ερωτήματα όμως που γεννώνται είναι αμείλικτα:

Πρώτον: πότε θα τα πάρουμε;

Δεύτερον: πόσο κοστίζουν;

Τρίτον: ποια μοντέλα θα πάρουμε;

Τέταρτον: αν θα φέρουν όπλα;

Το κυριότερο, το σημαντικότερο: ο ίδιος υπέγραψε για να πάρουν οι Τούρκοι τα F16. Την ίδια στιγμή αυτοδιαψεύδεται όταν λέει ότι δεν θα χρησιμοποιηθούν αυτά εναντίον της Ελλάδας, ενώ η αδελφή του κα. Ντόρα Μπακογιάννη λέει ότι είναι αδύνατο να μην χρησιμοποιηθούν.

Ταυτοχρόνως είχαμε και την κα. Νούλαντ, η οποία είπε στην Τουρκία καλώς ορίσατε στα F35!

Για το θέμα των F35, επειδή γίνεται πολλή κουβέντα, πρέπει να μας απαντήσει ο Έλληνας πρωθυπουργός πόσο ακριβώς κοστίζει το κάθε αεροσκάφος.
Γιατί, φιλοκυβερνητική εφημερίδα μας είχε πει πριν λίγους μήνες ότι κοστίζει 80 εκατομμύρια ευρώ το ένα. Τώρα ξαφνικά φαίνεται ότι η τιμή τριπλασιάζεται.
Το ερώτημα λοιπόν γεννάται και είναι αυτονόητο: πού θα πάνε τα λεφτά αυτά;
Το δεύτερο ερώτημα που γεννάται είναι για τα έργα  υποδομής που χρειάζονται. Οι φίλοι του, οι εθνικοί εργολάβοι, θα πάρουν πάρα πολλά λεφτά για να κάνουν τις υποδομές.
Θα μας πει ο Έλληνας πρωθυπουργός, πόσα χρήματα του ελληνικού λαού θα δώσει για να πάρει τα F35, ναι ή όχι;

Ο πολιτικός παραλογισμός του πρωθυπουργού δεν έχει όρια. Στο Bloomberg, λοιπόν, και στο Νταβός μας μίλησε για το δημογραφικό, για τη λαθρομετανάστευση και για το γάμο ομοφυλοφίλων.

Θα λύσει το δημογραφικό ο πρωθυπουργός, φέρνοντας και άλλους λαθρομετανάστες στην Ελλάδα;

Και πώς μπορείς να λύσεις το δημογραφικό, κε. Πρωθυπουργέ, με τα ομοφυλόφιλα ζευγάρια που βιάζεσαι fast track να επιβάλεις; Θα γεννήσουν κι άλλα παιδιά αυτοί;

Γι’ αυτό μιλάμε για πολιτικό παραλογισμό και κυρίως για εθνοκτονία.

ΠΑΣΟΚ, ΝΔ και ΣΥΡΙΖΑ είναι το ίδιο πράγμα, το έχουμε πει εδώ και πάρα πολύ καιρό, ακόμα και στην οπαδική βία. Από το 2003 θέλουν να λάβουν μέτρα, π.χ. οι κάμερες. 

Εγώ ρωτώ λοιπόν τα τρία κόμματα που κυβέρνησαν: επί 20 χρόνια γιατί δεν έβαζαν τις κάμερες; Γιατί φοβόταν; Ποιόν φοβόταν; Μάλλον φοβόταν αυτούς που τους συνδράμουν στις εκλογές πολλές φορές, και είναι οι ολιγάρχες. 

Εκεί που επιμένουμε εμείς, και θα επιμείνουμε περισσότερο, σε ένα ερώτημα: οι υγιείς φίλαθλοι, που πλήρωσαν δικό τους εισιτήριο, ένα διαρκείας, από ποιόν θα αποζημιωθούν ; από τον κο. Μητσοτάκη;

Πραγματικά το πολιτικό προσωπικό της χώρας είναι εκτός πραγματικότητας. Ακόμα και σήμερα λένε όλοι ότι κέρδισαν. Όλοι είναι νικητές. 

Εμείς ρωτάμε: ποιος έχασε; Θα μας πουν; 

Αν θέλουν να μάθουν ποιος έχασε, έχασε η Δημοκρατία με την τεράστια αποχή και ουσιαστικά ο ελληνικός λαός, ο οποίος θα απωλέσει και την πλέον τελευταία του ελπίδα για να διορθωθούν τα πράγματα, γιατί είναι αμετανόητοι και ζουν στον δικό τους κόσμο, σε όλα τα κόμματα.

Η ΝΔ δεν ακούει την ΕΛΛΗΝΙΚΗ ΛΥΣΗ που το ΦΩΝΑΖΕΙ καιρό τώρα.
ΚΛΕΙΣΤΕ ΟΛΕΣ ΤΙΣ ΜΚΟ, είναι επικίνδυνες!
Πώς να τους πιστέψουμε;
